import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      <ul className="online_store">
        <li>ONLINE STORE</li>
        <li>MEN CLOTHING</li>
        <li>WOMEN CLOTHING</li>
        <li>MEN ACCEESSORIES</li>
        <li>WOMEN ACCEESSORIES</li>
      </ul>
      <ul className="helpful_links"></ul>
      <ul className="partners"></ul>
      <ul className="address"></ul>
    </footer>
  );
};

export default Footer;
